import './App.css';

function App() {

  let todos = ['Morning routine', 'Coding' , 'Workout', 'Time w fav people']
  let todoList = todos.map((todo, i) => <li type='none'>Task: {todo}</li>)
  return (
    <div className="App">
      <ul>
        {todoList}
      </ul>
    </div>
  );
}

export default App;
